window.bookSummaryJSON = "<p>Lilith thought moving would make her life easier.</p> <p>Having survived a death sentence, Lilith believed moving to Paragon City would be safer, as there she’d be one of countless superhumans. Her dreams are short-lived, however, as the plots of the sinister Dreamer and a malevolent alien intersect with her attempt to build a new life with Gina and Rachel.</p> <p>Unfortunately for them, Lilith isn’t willing to let the villains do as they please.</p>"; 
